import React, { useState, useEffect } from 'react';
import { VuiFlexContainer, VuiFlexItem, VuiTitle, VuiText, VuiSpacer } from '../../ui';
import { AppHeader } from '../chrome/AppHeader';
import './harvardManagementDocuments.scss';
import { useSearchContext } from '../../contexts/SearchContext';

// Define document type
interface Document {
  id: string;
  title: string;
  date: string;
  type: string;
  company: string;
  description?: string;
  url?: string;
}

// Sample documents
const DOCUMENTS: Document[] = [
  {
    id: "doc-001",
    title: "10-k Apple.pdf",
    date: "2024",
    type: "10-K",
    company: "Apple"
  },
  {
    id: "doc-002",
    title: "10-k Goldman Sachs.pdf",
    date: "2024",
    type: "10-K",
    company: "Goldman Sachs"
  },
  {
    id: "doc-003",
    title: "Tiger Global.pdf",
    date: "2024",
    type: "Investment Report",
    company: "Tiger Global"
  },
  {
    id: "doc-004",
    title: "Bridgewater Associates.pdf",
    date: "2024",
    type: "Investment Report",
    company: "Bridgewater Associates"
  },
  {
    id: "doc-005",
    title: "investment-monthly-jan25.pdf",
    date: "January 2025",
    type: "Market Outlook",
    company: "Harvard Management Company"
  },
  {
    id: "doc-006",
    title: "weekly-investment-commentary-en-us-20250310-big-policy-shifts-reinforce-higher-rates.pdf",
    date: "March 10, 2025",
    type: "Market Commentary",
    company: "Harvard Management Company"
  },
  {
    id: "doc-007",
    title: "article_thebeatoutlook2025.pdf",
    date: "2025",
    type: "Market Outlook",
    company: "Harvard Management Company"
  },
  {
    id: "doc-008",
    title: "210630 IFM Australian Private Equity Fund IV - Quarterly Report.pdf",
    date: "June 30, 2021",
    type: "Quarterly Report",
    company: "IFM Australian Private Equity Fund IV"
  },
  {
    id: "doc-009",
    title: "2309 ICPF Quarterly Report.pdf",
    date: "September 2023",
    type: "Quarterly Report",
    company: "ICPF"
  },
  {
    id: "doc-010",
    title: "210331 SPE3 Quarterly Report.pdf",
    date: "March 31, 2021",
    type: "Quarterly Report",
    company: "SPE3"
  },
  {
    id: "doc-011",
    title: "2306 Morgan Stanley - Quarterly Report.pdf",
    date: "June 2023",
    type: "Quarterly Report",
    company: "Morgan Stanley"
  },
  {
    id: "doc-012",
    title: "Capstone 13-F Information Table.pdf",
